const e=JSON.parse('{"key":"v-16526fa2","path":"/GameEngine/Unity/manual/normal/assetbundle.html","title":"AssetBundle","lang":"en-US","frontmatter":{"date":"2021-03-23T08:46:10.000Z","tag":["Unity","Asset File"]},"headers":[],"git":{"createdTime":1699280150000,"updatedTime":1707213711000,"contributors":[{"name":"BanMing","email":"ban-ming@foxmail.com","commits":2},{"name":"wupeng","email":"wupeng_a2484@virtuos.com.cn","commits":2}]},"readingTime":{"minutes":0.46,"words":138},"filePathRelative":"GameEngine/Unity/manual/normal/assetbundle.md","localizedDate":"March 23, 2021","excerpt":"<h1> AssetBundle</h1>\\n<ul>\\n<li>打包设置中加上BuildAssetBundleOptions.DisableWriteTypeTree\\n可以试包体内容减少，加载速度减少，同时也减少了内存。</li>\\n</ul>\\n<p>TypeTree是来存储unity版本信息的一个东西，在加上这个的前提是保证一直使用的统一版本unity打包。</p>\\n<ul>\\n<li>打包完了ab，就不能修改c#层的挂在游戏物体上的脚本中的变量的访问权限\\n一个预制件在异步加载时不要使用同步加载</li>\\n</ul>\\n<figure><img src=\\"https://edrawcloudpubliccn.oss-cn-shenzhen.aliyuncs.com/viewer/self/16747446/share/2020-4-11/1586596976/main.svg\\" alt=\\"\\" tabindex=\\"0\\" loading=\\"lazy\\"><figcaption></figcaption></figure>"}');export{e as data};
